dot_wall = dict() #create dictionary

### creating the top wall and bottom wall ###
dot_wall["wall_top"] = Polygon([(23, 21), (3, 21), (3, 20), (23,20)])
dot_wall["wall_bottom"] = Polygon([(0, 4), (20, 4), (20, 3),(0,3)])

### Parameters for the dot field ###
field_size_y=5      # number of rows of dots
field_size_x=7      # dots in each row
distance=3          # distance from one dot to another in x and y direction
radius=0.8          # radius of the dots
displaced=True      # if true: dot rows in x-direction are displaced to each other
orientation_x=1.5   # x-position of the dot on the bottom left
orientation_y=5.5   # y-position of the dot on the bottom left

### creating the dot field ###
for i in range(field_size_x):
    for j in range(field_size_y):
        name="obs_dot_"+str(i)+"_"+str(j)
        i=int(i)
        j=int(j)
        if (j%2==0 and displaced==True):
            x=orientation_x+(distance/2)+distance*i
        else:
            x=orientation_x+distance*i
       
        y=orientation_y+distance*j
        dot_wall[name] = Point([x,y]).buffer(radius)


description="Two Walls with dots between the walls"
benchList.append(Benchmark("Wall of Dots", CollisionChecker(dot_wall), [[1,1]], [[22,22]], description, 2))

